import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="container" >
      <div className="navbar bg-warning">
        <div>Logo</div>
        <div>Search</div>
        <div>Exit</div>
      </div>

      <div className="d-flex bd-hightlight">
        <div className = "bg-danger vw-25">
          <div>
            <button className="btn btn-danger">ADD</button>
          </div>
          <div>FILT</div>
        </div>
        <div className = "flex-grow-1 bg-success">List Note</div>
      </div>



    </div>
  );
}

export default App;
